/* Common Namespaces */
/* Base Element Styles */

@font-face {
    font-family: 'FontAwesome';
    src:         url('https://netdna.bootstrapcdn.com/font-awesome/3.2.1/font/fontawesome-webfont.eot?v=3.2.1');
    src:         url('https://netdna.bootstrapcdn.com/font-awesome/3.2.1/font/fontawesome-webfont.eot?#iefix&v=3.2.1') format('embedded-opentype'), url('https://netdna.bootstrapcdn.com/font-awesome/3.2.1/font/fontawesome-webfont.woff?v=3.2.1') format('woff'), url('https://netdna.bootstrapcdn.com/font-awesome/3.2.1/font/fontawesome-webfont.ttf?v=3.2.1') format('truetype'), url('https://netdna.bootstrapcdn.com/font-awesome/3.2.1/font/fontawesome-webfont.svg#fontawesomeregular?v=3.2.1') format('svg');
    font-weight: normal;
    font-style:  normal;
}

body {
    background-color: #111 !important;
    color:            #FFF;
}

.gwt-TabBar .gwt-TabBarItem {
    color: #FA0;
}

.gwt-TabBar .gwt-TabBarItem-selected {
    color: #FF0;
}

.gwt-TabBar .gwt-TabBarRest {
    background: transparent !important;
}

body,
button,
a {
    font: 13px / 1.4 Helvetica, arial, nimbussansl, liberationsans, freesans, clean, sans-serif, 'FontAwesome', 'Apple Color Emoji', 'Segoe UI Emoji', 'Segoe UI Symbol';
}

table td {
    font: 13px / 1.4 Helvetica, arial, nimbussansl, liberationsans, freesans, clean, sans-serif, 'FontAwesome', 'Apple Color Emoji', 'Segoe UI Emoji', 'Segoe UI Symbol';
}

a {
    color: #86BFFC;
}

a:visited {
    color: #86BFFC;
}

div.menuBarUserNamePanel {
    background-color: #333 !important;
    background-image: linear-gradient(#444, #222) !important;
    border:           1px solid #333 !important;
    color:            #DDD !important;
}

button[type='button'],
button.gwt-Button,
div.unifiedTable button {
    -moz-user-select:    none;
    -ms-user-select:     none;
    -webkit-appearance:  none;
    -webkit-user-select: none;
    background:          inherit;
    background-color:    #000;
    background-image:    linear-gradient(#333, #111);
    border:              1px solid #333 !important;
    border-radius:       3px !important;
    color:               #DDD;
    cursor:              pointer;
    display:             inline-block;
    font-family:         Helvetica, arial, nimbussansl, liberationsans, freesans, clean, sans-serif, 'FontAwesome', 'Apple Color Emoji', 'Segoe UI Emoji', 'Segoe UI Symbol' !important;
    font-size:           13px !important;
    font-weight:         bold;
    line-height:         20px !important;
    padding:             4px 10px !important;
    position:            relative;
    user-select:         none;
    vertical-align:      middle;
    white-space:         nowrap;
}

select {
    border:        1px solid #D5D5D5 !important;
    border-radius: 3px !important;
    font-size:     13px !important;
    height:        24px !important;
}

select option:after {
    content:      '\f0d7';
    font-family:  'FontAwesome';
    font-size:    14px;
    padding-left: 10px;
}

#gerrit_btmmenu {
    padding: 20px;
}

#gerrit_btmmenu > * {
    display: none;
}

.inputFieldTypeHint {
    color: #CCC !important;
}

.com-google-gwtexpui-user-client-Tooltip-Css-tooltip {
    display: none !important;
}

.com-google-gerrit-client-change-Topic_BinderImpl_GenCss_style-edit {
    /* transparent image */
    content:  url('data:image/gif;base64,R0lGODlhAQABAIAAAP///wAAACH5BAEAAAAALAAAAAABAAEAAAICRAEAOw==');
    cursor:   pointer;
    position: absolute;
    right:    0;
    top:      0;
}

.com-google-gerrit-client-change-Topic_BinderImpl_GenCss_style-edit:after {
    content:     '\f044';
    font-family: 'FontAwesome';
    font-size:   16px;
}

.com-google-gerrit-client-change-ChangeScreen_BinderImpl_GenCss_style-projectSettings {
    color:  #333;
    height: 16px;
    width:  16px;
}

.com-google-gerrit-client-change-ChangeScreen_BinderImpl_GenCss_style-projectSettings:before {
    content:     '\f013';
    font-family: 'FontAwesome';
    font-size:   16px;
}

.com-google-gerrit-client-change-ChangeScreen_BinderImpl_GenCss_style-projectSettings:hover {
    color:           #4078C0 !important;
    text-decoration: none;
}

.com-google-gerrit-client-change-ChangeScreen_BinderImpl_GenCss_style-projectSettings img {
    display: none;
}

.com-google-gerrit-client-change-ChangeScreen_BinderImpl_GenCss_style-pushCertStatus {
    display: none;
}

div.gerrit-size {
    white-space: nowrap;
}

div.gerrit-size span.gerrit-size-block {
    background:     #DDD;
    display:        inline-block;
    height:         8px;
    margin-left:    1px;
    vertical-align: middle;
    width:          8px;
}

div.gerrit-size span.gerrit-size-block-add {
    background: #6CC644;
}

div.gerrit-size span.gerrit-size-block-rem {
    background: #BD2C00;
}

div.gerrit-state {
    color:       #6CC644;
    font-family: 'FontAwesome';
    font-size:   16px;
    height:      16px;
    text-align:  center;
    width:       20px;
}

div.gerrit-state-plus-one:before {
    content:     '\f087';
    font-family: 'FontAwesome';
}

div.gerrit-state-plus-two:before {
    content:     '\f164';
    font-family: 'FontAwesome';
}

div.gerrit-state-minus-one:before {
    color:       #BD2C00;
    content:     '\f088';
    font-family: 'FontAwesome';
}

div.gerrit-state-minus-two:before {
    color:       #BD2C00;
    content:     '\f165';
    font-family: 'FontAwesome';
}

#gerrit_topmenu {
    background:    #222;
    border-bottom: 1px solid #444;

}

table.topmenu td.topmenuTDglue {
    display: none;
}

table.topmenu td.topmenuTDmenu {
    position: relative;
}

table.topmenu td.topmenuTDmenu:first-child {
}

div.searchPanel {
    background-color:    #444;
    background-position: right 8px center;
    background-repeat:   no-repeat;
    border:              1px solid #222;
    border-radius:       3px;
    box-shadow:          inset 0 1px 2px rgba(0, 0, 0, 0.075);
    color:               #333;
    display:             inline-block;
    font-size:           12px;
    line-height:         17px;
    min-height:          26px;
    outline:             none;
    padding:             0;
    position:            relative;
    vertical-align:      middle;
}

div.searchPanel button {
    display:     inline-block;
    border:      0 !important;
    border-left: 1px #666 solid !important;
}

div.searchPanel input.gwt-TextBox {
    background:  none;
    border:      0;
    box-shadow:  none;
    color:       #EEE;
    display:     inline-block;
    font-size:   12px;
    line-height: 16px;
    margin:      0 !important;
    min-height:  22px;
    padding:     3px 5px;
    width:       250px;
}

.topmenuMenuLeft tbody tr td table.gwt-TabBar {
    border:         0 !important;
    padding-bottom: 10px;
}

.topmenuMenuLeft .gwt-TabBarItem-wrapper {
    height:         2px;
    vertical-align: top !important;
}

.topmenuMenuLeft .gwt-TabBarRest-wrapper > div {
    width: 144px;
}

.topmenuMenuLeft a.menuItem {
    color:       #AAA;
    display:     inline-block;
    height:      20px;
    margin-left: 16px;
    padding:     0;
}

.menuScreenMenuBar {
    background: #222;
}

.menuScreenMenuBar .menuItem.activeRow, .menuItem.activeRow {
    background:            #4078C0;
    color:                 #FFF !important;
    font-weight:           bold;
    padding:               0 5px !important;
    -webkit-border-radius: 5px;
    -moz-border-radius:    5px;
    border-radius:         5px;
}

div.menuBarUserNamePanel {
    -moz-user-select:    none;
    -ms-user-select:     none;
    -webkit-appearance:  none;
    -webkit-user-select: none;
    background-color:    #EEE;
    background-image:    linear-gradient(#FCFCFC, #EEE);
    border:              1px solid #D5D5D5;
    border-radius:       3px;
    color:               #333;
    cursor:              pointer;
    display:             inline-block;
    font-weight:         bold;
    line-height:         18px;
    padding:             4px 12px;
    position:            relative;
    user-select:         none;
    vertical-align:      middle;
    white-space:         nowrap;
}

.gwt-TabBarItem {
    margin-left: 16px !important;
    padding:     0 !important;
}

.gwt-TabBarItem .gwt-Label {
    color: #EEE;
}

.gwt-TabBarItem-selected {
    border-bottom: 2px solid #4078C0 !important;
    color:         #4078C0;
}

.gwt-TabBarItem-selected .gwt-Label {
    color: #4078C0;
}

.com-google-gerrit-client-change-RelatedChanges-RelatedChangesCss-tabPanel .gwt-TabBarItem {
    margin:                          0 1px !important;
    background:                      #9CF !important;
    border:                          0 !important;
    padding:                         2px 4px !important;
    -webkit-border-top-left-radius:  3px;
    -webkit-border-top-right-radius: 3px;
    -moz-border-radius-topleft:      3px;
    -moz-border-radius-topright:     3px;
    border-top-left-radius:          3px;
    border-top-right-radius:         3px;
}

.com-google-gerrit-client-change-RelatedChanges-RelatedChangesCss-tabPanel .gwt-TabBarItem .gwt-Label {
    color: #004D99 !important;
}

.com-google-gerrit-client-change-RelatedChanges-RelatedChangesCss-tabPanel .gwt-TabBarItem-selected {
    background: #FFFF80 !important;
    outline:    none;
}

.com-google-gerrit-client-change-RelatedChanges-RelatedChangesCss-tabPanel .gwt-TabBarItem-selected .gwt-Label {
    color: #000 !important;
}

.com-google-gerrit-client-change-Message_BinderImpl_GenCss_style-avatar {
    display: none;
}

/* Popups and Menus */
div.userInfoPopup,
div.suggestBoxPopup,
div.com-google-gerrit-client-change-ChangeScreen_BinderImpl_GenCss_style-replyBox {
    background-clip:  padding-box;
    background-color: #333;
    border:           1px solid rgba(200, 200, 200, 0.4);
    border-radius:    3px;
    box-shadow:       0 3px 12px rgba(0, 0, 0, 0.15);
    color:            #666;
    font-size:        12px;
    margin-bottom:    20px;
    margin-top:       4px;
    overflow:         hidden;
    position:         relative;
    width:            300px;
}

.com-google-gerrit-client-change-PatchSetsBox_BinderImpl_GenCss_style-table tr.com-google-gerrit-client-change-PatchSetsBox_BinderImpl_GenCss_style-current {
    background-color: #06C
}

.gwt-TextArea {
    display:    block;
    width:      99%;
    background: #222;
    color:      #EEE;
}

div.suggestBoxPopup {
    margin: 4px 0 0 -2px;
    width:  264px;
}

div.suggestBoxPopup table {
    width: 100%;
}

div.suggestBoxPopup .suggestPopupMiddleLeft,
div.suggestBoxPopup .suggestPopupMiddleRight {
    display: none;
}

div.suggestBoxPopup .item-selected {
    background: #EEE;
}

div.suggestPopupContent table {
    padding-left: 2px;
    width:        260px;
}

.popupContent {
    color:      #FFF;
    background: #333;
}

#change_infoTable .gwt-InlineHyperlink {
    color:         #EEE;
    display:       inline-block;
    min-height:    16px;
    padding-right: 22px;
    width:         100%;
}

#change_infoTable tr:nth-child(7) div {
    position: relative;
}

#change_infoTable tr:nth-child(7) .gwt-InlineHyperlink:after {
    content:     '\f044';
    font-family: 'FontAwesome';
    font-size:   16px;
    position:    absolute;
    right:       0;
    top:         0;
}

#change_infoTable tr:nth-child(7) .gwt-InlineHyperlink:hover:after {
    color: #4078C0 !important;
}

table.changeTable {
    position: relative;
    color:    #EEE;
}

table.changeTable .activeRow,
table.changeTable .activeRow td,
table.changeTable.accountDashboard .activeRow,
table.changeTable.accountDashboard.changeTable .activeRow td,
table.changeTable.accountDashboard.changeTable .activeRow a,
.com-google-gerrit-client-change-RelatedChanges-RelatedChangesCss-activeRow {
    background: #154A82 !important;
}

.changeTable .dataCell.labelNotApplicable {
    background: transparent !important;
}

table.changeTable td.cSIZE {
    width: 46px;
}

table.changeTable td.iconCell,
table.changeTable td.dataCell {
    border-bottom: 1px solid #222;
    border-left:   0;
    border-right:  0;
}

table.changeTable td:last-child {
    border-right: 1px solid #E5E5E5 !important;
}

table.changeTable tbody tr:first-child td {
    background:    #444;
    border:        0 !important;
    border-bottom: 1px solid #555 !important;
    border-top:    1px solid #555 !important;
    color:         #CCC;
    padding:       3px 12px;
    text-shadow:   1px 1px #000;
    font-weight:   bold;
}

table.changeTable tbody tr:first-child td:last-child {
    border-radius: 0 3px 0 0;
    border-right:  1px solid #444 !important;
    padding-right: 10px;
}

table.changeTable tbody tr:first-child td:first-child {
    border-radius: 3px 0 0 0;
    border-left:   1px solid #444 !important;
    padding-left:  10px;
}

table.changeTable a.gwt-InlineHyperlink,
table.changeTable a.gwt-Anchor {
    color: #CCC !important;
}

table.changeTable td:last-child {
    border-right: none !important
}

table.changeTable td {
    border:     none;
    background: #222;
}

table.changeTable tr {
    border: 1px #444 solid;
}

.com-google-gerrit-client-change-ChangeScreen_BinderImpl_GenCss_style-label_need {
    color: #DDD;
}

.com-google-gerrit-client-change-ChangeScreen_BinderImpl_GenCss_style-label_ok {
    color: #3FCC00;
}

.accountDashboard.changeTable tr {
    color: #DDD;
}

.accountDashboard.changeTable .needsReview,
.accountDashboard.changeTable .needsReview a {
    color: #FFF;
}

.accountDashboard tbody tr:first-child td.iconHeader,
.accountDashboard tbody tr:first-child td.dataHeader {
    background:  transparent !important;
    border:      1px solid transparent !important;
    color:       #CCC;
    font-style:  normal;
    text-shadow: 1px 1px #000;
    font-weight: bold !important;
}

.accountDashboard tbody tr:first-child td.dataHeader:nth-child(12) {
    width: 18px;
}

.accountDashboard tbody tr:first-child td.dataHeader:nth-child(11) {
    width: 30px;
}

.accountDashboard tbody tr:first-child td.dataHeader:nth-child(10) {
    width: 54px;
}

.accountDashboard tbody tr:first-child td.dataHeader:nth-child(9) {
    width: 88px;
}

.accountDashboard tbody tr:first-child td.dataHeader:nth-child(8) {
    width: 100px;
}

.accountDashboard tbody tr:first-child td.dataHeader:nth-child(7) {
    width: 100px;
}

.accountDashboard tbody tr:first-child td.dataHeader:nth-child(6) {
    width: 124px;
}

.accountDashboard tbody tr:first-child td.dataHeader:nth-child(5) {
    width: 70px;
}

td.sectionHeader,
table.accountDashboard.changeTable td.sectionHeader:last-child {
    background:     #333 !important;
    border-right:   0 !important;
    border-top:     10px solid #111 !important;
    padding-top:    4px;
    padding-right:  6px;
    padding-bottom: 4px;
    padding-left:   6px;
    position:       relative;
    color:          #DDD !important;
    font-weight:    bold;
}

td.sectionHeader a {
    background-color: #222 !important;
    border-bottom:    1px solid #555 !important;
    border-top:       1px solid #555 !important;
    border-radius:    3px 3px 0 0;
    display:          block;
    padding:          12px 10px;
}

td.emptySection {
    border:     1px solid #333 !important;
    border-top: 0px !important;
}

td.cSUBJECT a {
    display:        inline-block;
    overflow:       hidden;
    text-overflow:  ellipsis;
    vertical-align: middle;
    white-space:    nowrap;
    width:          466px;
}

td.cOWNER {
    width: 108px;
}

td.cSUBJECT,
td.dataCell:nth-child(7),
td.cOWNER {
    /* repo name cell */
    overflow:      hidden;
    text-overflow: ellipsis;
    white-space:   nowrap;
}

td.dataCell:nth-child(7) a {
    /* repo name cell */
    display:       inline-block;
    overflow:      hidden;
    text-overflow: ellipsis;
    white-space:   nowrap;
    width:         130px;
}

td.dataCell:nth-child(8) a {
    display:       inline-block;
    overflow:      hidden;
    text-overflow: ellipsis;
    white-space:   nowrap;
    width:         175px;
}

td.cAPPROVAL div.gerrit-state-minus-two:before {
    content:     '\f126';
    font-family: 'FontAwesome';
}

td.cAPPROVAL div.gerrit-state-plus-two:before {
    content:     '\f126';
    font-family: 'FontAwesome';
}

td.cSTATUS {
    overflow:   hidden;
    position:   relative;
    text-align: left;
}

.dataCell.cAPPROVAL {
    position: relative;
}

