td.cSTATUS:empty:after {
    background:    #145DD1;
    border-radius: 3px;
    color:         #FFF;
    content:       '\f126';
    font-family:   'FontAwesome';
    font-size:     16px;
    height:        16px;
    padding:       2px;
    position:      absolute;
    right:         2px;
    top:           2px;
    width:         16px;
    text-align:    center
